import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import { withStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Card from "./Card";
import { connect } from "react-redux";
import axios from "axios";
const styles = theme => ({
  fab: {
    marginLeft: "1200px"
  }
});
class Home extends React.Component {
  state = {
    // cards: [
    //   { id: 1, LocalcarrierCode: "XB" },
    //   { id: 2, LocalcarrierCode: "HC" }
    // ]
    cards: []
  };
  componentDidMount() {
    axios.get(`http://10.24.46.158:8080/carrierapi/getCarriers`).then(res => {
      const cards = res.data;
      console.log(cards);
      this.setState({ cards });
    });
  }
  handle = () => {
    this.props.history.push(`/admin/CarrierDetails`);
    // const cards = this.state.cards;
    // cards.push({ id: 3, LocalcarrierCode: "BA" });
    // this.setState(cards);
  };
  render() {
    console.log(this.props);
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "70vh"
        }}
      >
        <Grid container xs={12}>
          <Grid item xs={9}>
            {this.state.cards.map(card => (
              <Card
                key={card.id}
                LocalcarrierCode={card.carrierCode}
                selected={true}
              />
            ))}
          </Grid>
        </Grid>

        {/* <Grid item xs={12}> */}
        <Fab
          size="large"
          aria-label="Add"
          onClick={this.handle}
          className={this.props.fab}
        >
          <AddIcon />
        </Fab>
        {/* </Grid> */}
      </div>
    );
  }
}
const mapStateToProps = state => {
  return state;
};

const Reduxhome = connect(mapStateToProps)(Home);
export default withStyles(styles)(Reduxhome);
